import React from "react";
import './Fifth.css';

function App() {

  return (
<div className="Fifthm">
    <div className="Fifthmbox">
    <div className="ab" id="mhs">
        <div className="dp"><a className="adp" href="/#t"><img src={require("./")} id="pic" alt="pic" /></a></div>
    </div>
    <div className="ab" id="nim">
        <div className="dp"><a className="adp" href="/#t"><img src={require("./")} id="pic" alt="pic" /></a></div>
    </div>
    <div className="ab" id="arp">
        <div className="dp"><a className="adp" href="/#t"><img src={require("./")} id="pic" alt="pic" /></a></div>
    </div>
    </div>
</div>

  );
}

export default App;
